import React from 'react';
import Header from './Header';
import About from './About';
import Gallery from './Gallery';
import Review from './Review';
import Contact from './Contact';
import Footer from './Footer';

const Main = () => {
  return (
    <div>
      <Header />
      <About />
      <Gallery />
      <Review />
      <Contact />
      <Footer />
    </div>
  );
};

export default Main;
